import React from 'react';
import {
  Box,
  Grid,
  Paper,
  Typography,
  Button,
  CircularProgress,
  Alert,
  useTheme,
  useMediaQuery,
} from '@mui/material';
import {
  AccountBalance as AccountIcon,
  Payment as PaymentIcon,
  TrendingUp as InvestmentIcon,
  Notifications as NotificationIcon,
} from '@mui/icons-material';
import { useQuery } from 'react-query';
import { api } from '../../services/api';
import { AccountCard } from './AccountCard';
import { TransactionList } from './TransactionList';
import { QuickActions } from './QuickActions';
import { NotificationCenter } from './NotificationCenter';
import { SpendingChart } from './SpendingChart';

export const UserDashboard: React.FC = () => {
  const theme = useTheme();
  const isMobile = useMediaQuery(theme.breakpoints.down('sm'));

  const { data: accountsData, isLoading: loadingAccounts } = useQuery(
    'accounts',
    () => api.get('/accounts')
  );

  const { data: transactionsData, isLoading: loadingTransactions } = useQuery(
    'recent-transactions',
    () => api.get('/transactions/recent')
  );

  const { data: notificationsData, isLoading: loadingNotifications } = useQuery(
    'notifications',
    () => api.get('/notifications')
  );

  const { data: spendingData, isLoading: loadingSpending } = useQuery(
    'spending-analytics',
    () => api.get('/transactions/spending-analytics')
  );

  if (loadingAccounts || loadingTransactions || loadingNotifications) {
    return (
      <Box display="flex" justifyContent="center" alignItems="center" minHeight="400px">
        <CircularProgress />
      </Box>
    );
  }

  return (
    <Box sx={{ flexGrow: 1, p: 3 }}>
      {/* Welcome Section */}
      <Paper
        sx={{
          p: 3,
          mb: 3,
          background: `linear-gradient(45deg, ${theme.palette.primary.main} 30%, ${theme.palette.primary.light} 90%)`,
          color: 'white',
        }}
      >
        <Typography variant="h4" gutterBottom>
          Welcome back, {accountsData?.user?.name}
        </Typography>
        <Typography variant="subtitle1">
          Here's your financial overview
        </Typography>
      </Paper>

      <Grid container spacing={3}>
        {/* Quick Actions */}
        <Grid item xs={12}>
          <QuickActions />
        </Grid>

        {/* Account Cards */}
        <Grid item xs={12}>
          <Typography variant="h6" gutterBottom>
            Your Accounts
          </Typography>
          <Grid container spacing={2}>
            {accountsData?.accounts.map((account: any) => (
              <Grid item xs={12} sm={6} md={4} key={account.id}>
                <AccountCard account={account} />
              </Grid>
            ))}
          </Grid>
        </Grid>

        {/* Recent Transactions and Spending Analytics */}
        <Grid item xs={12} md={8}>
          <Paper sx={{ p: 2 }}>
            <Typography variant="h6" gutterBottom>
              Recent Transactions
            </Typography>
            <TransactionList
              transactions={transactionsData?.transactions || []}
              loading={loadingTransactions}
            />
          </Paper>
        </Grid>

        <Grid item xs={12} md={4}>
          <Paper sx={{ p: 2 }}>
            <Typography variant="h6" gutterBottom>
              Spending Analytics
            </Typography>
            {loadingSpending ? (
              <CircularProgress />
            ) : (
              <SpendingChart data={spendingData} />
            )}
          </Paper>
        </Grid>

        {/* Notification Center */}
        <Grid item xs={12}>
          <Paper sx={{ p: 2 }}>
            <Typography variant="h6" gutterBottom>
              Notifications
            </Typography>
            <NotificationCenter
              notifications={notificationsData?.notifications || []}
              loading={loadingNotifications}
            />
          </Paper>
        </Grid>
      </Grid>
    </Box>
  );
};
